import { Component } from "react";
const styles = {
    navbar: {
        color: '#3e2623',
        marginBottom:'30px',
    }
}

class Navbar extends Component{
    render() {
        return (
        <nav style={styles.navbar}>
            <img src="../public/img/logo.png" alt="Logo de herencia la galicia" />
        </nav>  
        )
    }
}
export default Navbar
